SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET AUTOCOMMIT = 0;
START TRANSACTION;
SET time_zone = "+00:00";

CREATE TABLE `tweet` (
  `tweet_id` int(50) NOT NULL,
  `tweet_ori` varchar(140) NOT NULL,
  `tweet_clean` varchar(140) NOT NULL,
  `tweet_user` varchar(50) NOT NULL,
  `tweet_date` datetime NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


ALTER TABLE `tweet`
  ADD PRIMARY KEY (`tweet_id`);

ALTER TABLE `tweet`
  MODIFY `tweet_id` int(50) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=1125;COMMIT;